import { TextareaAutosize, Toolbar } from '@material-ui/core';
import FooterStyle from './footer.style';
import { RadioButtonChecked as RadioIcon, Update as UpdateIcon, Tv as TvIcon } from '@material-ui/icons';

function Footer() {
  const styles = FooterStyle();

  return (
    <Toolbar className={styles.bar}>
      <RadioIcon className={styles.orange}/>
      <TextareaAutosize className={styles.orange}>NO AR</TextareaAutosize>
      <TvIcon />
      <TextareaAutosize>ENCONTRO - 10:00</TextareaAutosize>
      <TvIcon />
      <TextareaAutosize>Última atualização em 10:28</TextareaAutosize>
      <TextareaAutosize>Quinta, 30 de Maio de 2019</TextareaAutosize>
      <TextareaAutosize>// 10:30:42</TextareaAutosize>
      </Toolbar>
  );
}

export default Footer;
